import React, { useState, useEffect } from "react";
import { userService, bookingService, propertyService } from "../services/api";
import "../styles/AdminDashboard.css";

const AdminDashboard = () => {
    const [activeTab, setActiveTab] = useState("bookings");
    const [bookings, setBookings] = useState([]);
    const [users, setUsers] = useState([]);
    const [properties, setProperties] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState("");

    useEffect(() => {
        fetchData();
    }, [activeTab]);

    const fetchData = async () => {
        setLoading(true);
        setError("");
        try {
            if (activeTab === "bookings") {
                const response = await bookingService.getBookings({ limit: 100 });
                setBookings(response.data.data);
            } else if (activeTab === "users") {
                const response = await userService.getAllUsers({ limit: 100 });
                setUsers(response.data.data);
            } else if (activeTab === "properties") {
                const response = await propertyService.getAllProperties({ limit: 100 });
                setProperties(response.data.data);
            }
        } catch (err) {
            setError(err.response?.data?.message || "Failed to fetch data");
        } finally {
            setLoading(false);
        }
    };

    const handleApproveBooking = async (id) => {
        try {
            await bookingService.approveBooking(id);
            alert("Booking approved!");
            fetchData();
        } catch (err) {
            alert("Failed to approve booking");
        }
    };

    const handleRejectBooking = async (id) => {
        try {
            await bookingService.rejectBooking(id);
            alert("Booking rejected!");
            fetchData();
        } catch (err) {
            alert("Failed to reject booking");
        }
    };

    const handleDeleteUser = async (id) => {
        if (window.confirm("Are you sure you want to delete this user?")) {
            try {
                await userService.deleteUser(id);
                alert("User deleted!");
                fetchData();
            } catch (err) {
                alert("Failed to delete user");
            }
        }
    };

    const handleDeleteProperty = async (id) => {
        if (window.confirm("Are you sure you want to delete this property?")) {
            try {
                await propertyService.deleteProperty(id);
                alert("Property deleted!");
                fetchData();
            } catch (err) {
                alert("Failed to delete property");
            }
        }
    };

    return (
        <div className="admin-dashboard">
            <h2>Admin Dashboard</h2>

            <div className="tab-buttons">
                <button
                    className={activeTab === "bookings" ? "active" : ""}
                    onClick={() => setActiveTab("bookings")}
                >
                    Bookings ({bookings.length})
                </button>
                <button
                    className={activeTab === "users" ? "active" : ""}
                    onClick={() => setActiveTab("users")}
                >
                    Users ({users.length})
                </button>
                <button
                    className={activeTab === "properties" ? "active" : ""}
                    onClick={() => setActiveTab("properties")}
                >
                    Properties ({properties.length})
                </button>
            </div>

            {error && <div className="error-message">{error}</div>}

            <div className="tab-content">
                {loading && <div className="loading">Loading...</div>}

                {!loading && activeTab === "bookings" && (
                    <div className="bookings-table">
                        <h3>Pending Bookings</h3>
                        <table>
                            <thead>
                                <tr>
                                    <th>Property</th>
                                    <th>User</th>
                                    <th>Visit Date</th>
                                    <th>Status</th>
                                    <th>Actions</th>
                                </tr>
                            </thead>
                            <tbody>
                                {bookings.map(booking => (
                                    <tr key={booking._id}>
                                        <td>{booking.property.title}</td>
                                        <td>{booking.fullName}</td>
                                        <td>{new Date(booking.visitDate).toLocaleDateString()}</td>
                                        <td><span className={`status-${booking.status.toLowerCase()}`}>{booking.status}</span></td>
                                        <td>
                                            {booking.status === "Pending" && (
                                                <>
                                                    <button
                                                        onClick={() => handleApproveBooking(booking._id)}
                                                        className="approve-btn"
                                                    >
                                                        Approve
                                                    </button>
                                                    <button
                                                        onClick={() => handleRejectBooking(booking._id)}
                                                        className="reject-btn"
                                                    >
                                                        Reject
                                                    </button>
                                                </>
                                            )}
                                        </td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                    </div>
                )}

                {!loading && activeTab === "users" && (
                    <div className="users-table">
                        <h3>Users</h3>
                        <table>
                            <thead>
                                <tr>
                                    <th>Name</th>
                                    <th>Email</th>
                                    <th>Role</th>
                                    <th>Actions</th>
                                </tr>
                            </thead>
                            <tbody>
                                {users.map(user => (
                                    <tr key={user._id}>
                                        <td>{user.name}</td>
                                        <td>{user.email}</td>
                                        <td>{user.role}</td>
                                        <td>
                                            <button
                                                onClick={() => handleDeleteUser(user._id)}
                                                className="delete-btn"
                                            >
                                                Delete
                                            </button>
                                        </td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                    </div>
                )}

                {!loading && activeTab === "properties" && (
                    <div className="properties-table">
                        <h3>Properties</h3>
                        <table>
                            <thead>
                                <tr>
                                    <th>Title</th>
                                    <th>Type</th>
                                    <th>Price</th>
                                    <th>City</th>
                                    <th>Status</th>
                                    <th>Actions</th>
                                </tr>
                            </thead>
                            <tbody>
                                {properties.map(property => (
                                    <tr key={property._id}>
                                        <td>{property.title}</td>
                                        <td>{property.propertyType}</td>
                                        <td>â‚¹{property.price.toLocaleString()}</td>
                                        <td>{property.location.city}</td>
                                        <td>{property.status}</td>
                                        <td>
                                            <button
                                                onClick={() => handleDeleteProperty(property._id)}
                                                className="delete-btn"
                                            >
                                                Delete
                                            </button>
                                        </td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                    </div>
                )}
            </div>
        </div>
    );
};

export default AdminDashboard;
